import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import './LoginPage.css';

function Loginpage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [signupData, setSignupData] = useState({ name: '', email: '', password: '' });
  const [isFlipped, setIsFlipped] = useState(false);
  const navigate = useNavigate();

  const handleToggle = () => setIsFlipped(!isFlipped);

  const handleLogin = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('http://localhost:5000/api/users/login', {
        email,
        password,
      });

      console.log("Login response:", response.data);

      if (response.data && response.data.email) {
        localStorage.setItem('user', JSON.stringify(response.data));
        navigate('/userprofile');
      } else {
        alert("Login failed: User data not found");
      }
    } catch (error) {
      alert('Invalid credentials. Please try again.');
      console.error(error.response?.data || error.message);
    }
  };

 const handleSignup = async (e) => {
  e.preventDefault();

  try {
    const response = await axios.post('http://localhost:5000/api/users/register', signupData);
    console.log("Signup response:", response.data); // Use response
    alert('Registration successful! You can now log in.');
    setIsFlipped(false);
  } catch (error) {
    alert('Signup failed. Please try again.');
    console.error(error.response?.data || error.message);
  }
};

  return (
    <div className="wrapper">
      <div className="card-switch">
        <label className="switch">
          <input
            type="checkbox"
            className="toggle"
            checked={isFlipped}
            onChange={handleToggle}
          />
          <span className="slider"></span>
          <span className="card-side"></span>
          <div className={`flip-card__inner ${isFlipped ? 'flipped' : ''}`}>
            <div className="flip-card__front">
              <div className="title">Log in</div>
              <form className="flip-card__form" onSubmit={handleLogin}>
                <input
                  className="flip-card__input"
                  name="email"
                  placeholder="Email"
                  type="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                />
                <input
                  className="flip-card__input"
                  name="password"
                  placeholder="Password"
                  type="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                />
                <button className="flip-card__btn" type="submit">Let's go!</button>
              </form>
            </div>
            <div className="flip-card__back">
              <div className="title">Sign up</div>
              <form className="flip-card__form" onSubmit={handleSignup}>
                <input
                  className="flip-card__input"
                  placeholder="Name"
                  type="text"
                  value={signupData.name}
                  onChange={(e) => setSignupData({ ...signupData, name: e.target.value })}
                />
                <input
                  className="flip-card__input"
                  name="email"
                  placeholder="Email"
                  type="email"
                  value={signupData.email}
                  onChange={(e) => setSignupData({ ...signupData, email: e.target.value })}
                />
                <input
                  className="flip-card__input"
                  name="password"
                  placeholder="Password"
                  type="password"
                  value={signupData.password}
                  onChange={(e) => setSignupData({ ...signupData, password: e.target.value })}
                />
                <button className="flip-card__btn" type="submit">Confirm!</button>
              </form>
            </div>
          </div>
        </label>
      </div>
    </div>
  );
}

export default Loginpage;
